import * as fs from 'fs';
import * as path from 'path';
import { RequestType } from '../client';
import { ResponseType } from '../server';
/**
 * Class Add
 */
export class Add {
  constructor(private a: RequestType, private b: ResponseType){}
  /**
   * Method addNote
   * @returns Response
   */
  addNote(): ResponseType{ 
    if (!fs.existsSync(`./dist/${this.a.user}`)){
      fs.mkdir(path.join(__dirname, String(this.a.user)), (err) => {
        if (err) {
          this.b.success = false;
          this.b.notes?.push(String(err));
          return this.b;
        }
        else {
          this.b.notes?.push(`Created dir ${this.a.user} at ./dist/`);
        }
      });
    }
    //Sin timeout no se puede crear
    if (fs.existsSync(`./dist/${this.a.user}/${this.a.title}.json`)){
      this.b.success = false;
      this.b.notes?.push('This file already exists');
      return this.b;
    }
    else{
      setTimeout(() => {
        fs.writeFile(`./dist/${this.a.user}/${this.a.title}.json`, JSON.stringify(this.a, null, 2), 'utf8', (err) => {
          if (err) {
            this.b.success = false;
            this.b.notes?.push(String(err));
            return this.b;
          }
        });
      }, 1000);
    }
    this.b.notes?.push(`Created ${this.a.title}`);
    return this.b;
  }
}

import * as fs from 'fs';
import { RequestType } from '../client';
import { ResponseType } from '../server';
/**
 * Class List
 */
export class List {
  constructor(private a: RequestType, private b: ResponseType){}
  /**
   * Method list
   * @returns Response
   */
  list(): ResponseType{
    if (fs.existsSync(`./dist/${this.a.user}`)){      
      fs.readdir(`./dist/${this.a.user}`, (err, files) => {
        if (err) {
          this.b.success = false;
          this.b.notes?.push(String(err));
          return this.b;
        }
        else {
          files.forEach(element => {
            this.a = require(`../${this.a.user}/${element}`);
            this.b.notes?.push(element);
          });
        }
      });
    }
    else{
      this.b.success = false;
      this.b.notes?.push(`Invalid user: ${this.a.user}`);
    }
  return this.b;
  }
}

import * as fs from 'fs';
import { RequestType } from '../client';
import { ResponseType } from '../server';
/**
 * Class Modify
 */
export class Modify {
  constructor(private a: RequestType, private b: ResponseType){}
  /**
   * Method modify
   * @returns Response
   */
  modify(): ResponseType{
    if (fs.existsSync(`./dist/${this.a.user}/${this.a.title}.json`)){
      fs.writeFile(`./dist/${this.a.user}/${this.a.title}.json`, JSON.stringify(this.a, null, 2), 'utf8', (err) => {
        if (err) {
          this.b.success = false;
          this.b.notes?.push('This file already exists');
          return this.b;
        }
      });
    }
    else{
      this.b.success = false;
      this.b.notes?.push(`This file doesn't exists`);
      return this.b;
    }
    this.b.notes?.push(`Modified ${this.a.title}`);
    return this.b;
  }
}

import * as fs from 'fs';
import { RequestType } from '../client';
import { ResponseType } from '../server';
/**
 * Class Read
 */
export class Read {
  constructor(private a: RequestType, private b: ResponseType){}
  /**
   * Method read
   * @returns Response
   */
  read(): ResponseType{
    if (fs.existsSync(`./dist/${this.a.user}/${this.a.title}.json`)){
      this.a = require(`../${this.a.user}/${this.a.title}.json`);
      this.b.notes?.push(`${this.a.body}`);
    }
    else{
      this.b.success = false;
      this.b.notes?.push(`Invalid user: ${this.a.user} or filename: ${this.a.title}`);
    }
    return this.b;
  }
}

import * as fs from 'fs';
import { RequestType } from '../client';
import { ResponseType } from '../server';
/**
 * Class Remove
 */
export class Remove {
  constructor(private a: RequestType, private b: ResponseType){}
  /**
   * Method remove
   * @returns Response
   */
  remove(): ResponseType{
    if (fs.existsSync(`./dist/${this.a.user}/${this.a.title}.json`)){
      fs.promises.rm(`./dist/${this.a.user}/${this.a.title}.json`);
      this.b.notes?.push(`Note: ${this.a.user}/${this.a.title} removed`);
    }
    else{
      this.b.success = false;
      this.b.notes?.push(`Invalid user: ${this.a.user} or filename: ${this.a.title}`);
      return this.b;
    }
    return this.b;
  }
}
